const replaceDep = pom.dependencies.find((d) => d === dependency) if (!replaceDep) { continue } replaceDep.version = metadata.latestVersion pom.dependencies.splice( pom.dependencies.findIndex((d) => d === dependency), 1, replaceDep ) }
